import React from "react";
import styled from "styled-components";
import Header from "../components/Header/Header";
import Sidebar from "./Sidebar";

const Wrapper = styled.div`
  display: flex;
  max-width: 1600px;
  margin: 0 auto;
`;

const Main = () => {
  return (
    <>
      <Header />
      <Wrapper>
        <Sidebar />
      </Wrapper>
    </>
  );
};

export default Main;
